import React, {Component} from 'react';
import axios from 'axios';
var kk = {
    margin : "-10px"
        }
var lk = {
    height : "100%"
}


export default class Home extends React.Component {
    constructor(props){
        super(props);
        this.state={
            data:null,
        };  
    }

    getuserdata= () => {
        const f=document.getElementById("rara").value;
        const s=this.state.data
        for(let i=0;i<s.length;i++){
            if(f==s[i].id){
            console.log(s[i].username);
            var k=JSON.stringify(s[i].username);
            var pdata = (
                <h1>{k}</h1>
            );
        document.getElementById("root").innerHTML=pdata;
            }
        }
    }

    componentDidMount(){
        var self=this;  
        axios.get('http://127.0.0.1:8000/user/')
            .then((response)=> { 
                self.setState({data:response.data});

            })
            .catch(function(error){
                console.log(error);
            });
    }

    render() {
        return  (<div style={lk}><center> <img src="index.png" width="30" height="30" style={kk}/> &nbsp;&nbsp;&nbsp; Instagram &nbsp; &nbsp; &nbsp;&nbsp;
        <input type="text" placeholder="search"/> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <a><img src="images.png" onClick={this.getuserdata} width="30" height="30" style={kk}/></a> </center>
        <input type="number" id="rara"></input>
        </div>);
    } 
}
